import numpy as np
def my_test(s):
    ls=list(s)
    ab_i=max_l=l=ab_index=0
    ls_temp=list()
    while(ab_i<len(ls)):
        if ls[ab_i] not in ls_temp:
            ls_temp.append(ls[ab_i])#注意啦，list.append不需要加inplace也不需要重新赋值，这个是错误的ls_temp=ls_temp.append(ls[ab_i])
            l+=1
            ab_i+=1
        else:
            x_index=ls_temp.index(ls[ab_i])
            ab_index+=(x_index+1)
            ls_temp=[]
            l=0
            ab_i=ab_index
        max_l=max_l if max_l>l else l

    return max_l
def correct_test(s):
    d = {}
    start = 0
    ans = 0
    for i, c in enumerate(s):
        if c in d:
            start = max(start, d[c] + 1)
        d[c] = i
        ans = max(ans, i - start + 1)
    return ans
def fastest_test(s):
    dct = {}  # 当values和indexs一起操作的时候，一定要想到hash也就是python中的dict
    max_so_far = curr_max = start = 0
    # start可以说就是ab_index，是一个标杆。
    # 这里可以将s分成三段，第一段是已经检索过的，其中dct中存的是最新的不重复的已经检索过的value-index。
    #第二部分是当前认为没有重复的最长的，以start作为开始。长度是curr_max
    #第三部分是还没有检索过的，
    for index, value in enumerate(s):
        if value in dct and dct[value] >= start:
            #对于一个正要检索的value，如果它在dct中，且他的位置大于start，说明在他的前面（第二部分中），已经
            #有一个与它相同的value（这个value更新了dct中其对应的index>=start的发生）
            max_so_far = max(max_so_far, curr_max)
            curr_max = index - dct[value]
            #之所以这样更新curr_max，是因为，这两个相同的value中的所有值肯定不和他们一样，且不重复
            start = dct[value] + 1
            #从第一个重复的后一个开始
        else:
            curr_max += 1
        dct[value] = index
    return max(max_so_far, curr_max)


